import React from 'react';
import '../hoja-de-estilos/Inicio.css';
import Navegacion from './Navegacion';

const Inicio = () => {
  return (
    <header>
        <div className="contenedor-inicio">
            <h1>Mi tienda hecho con React</h1>
            <div className='logo'></div>
        </div>
    </header>
  );
};

export default Inicio;
